/* ROM header bytes for region detection */
static const u8 kRomHeaderGameCode[4] = { 0x42, 0x5A, 0x4D, 0x45 };

extern u8* gRomData;
extern u32 gRomSize;

/*
 * Port_LoadFromAssets â€” reconstruct gRomData from build/<REGION>/assets/ files.
 * Returns 1 on success (at least 50% of assets loaded), 0 on failure.
 */
int Port_LoadFromAssets(const char* assetsDir) {
    if (!assetsDir)
        return 0;

    /* Allocate ROM buffer if not already done */
    if (!gRomData) {
        gRomSize = ROM_IMAGE_SIZE;
        gRomData = (u8*)calloc(1, gRomSize);
        if (!gRomData) {
            fprintf(stderr, "ERROR: Failed to allocate %u bytes for ROM buffer\n", gRomSize);
            return 0;
        }
    }

    /* Write ROM header for region detection â€” only if not already set by a ROM file */
    if (gRomData[0xAC] == 0 && gRomData[0xAD] == 0 && gRomData[0xAE] == 0 && gRomData[0xAF] == 0) {
        gRomData[0] = 0x2E; /* ARM branch opcode byte */
        memcpy(&gRomData[0xAC], kRomHeaderGameCode, 4);
        gRomData[0xB2] = 0x96; /* fixed GBA header value */
    }

    u32 loaded = 0, skipped = 0;
    char pathBuf[512];

    for (u32 i = 0; i < ASSET_ENTRY_COUNT; i++) {
        const AssetEntry* e = &sAssetIndex[i];
        if (e->offset + e->size > gRomSize)
            continue;

        snprintf(pathBuf, sizeof(pathBuf), "%s/%s", assetsDir, e->path);
        FILE* f = fopen(pathBuf, "rb");
        if (!f) {
            skipped++;
            continue;
        }

        u32 readSize = (u32)fread(&gRomData[e->offset], 1, e->size, f);
        fclose(f);
        if (readSize > 0)
            loaded++;
        else
            skipped++;
    }

    fprintf(stderr, "Assets loaded: %u/%u from %s (%u skipped)\n", loaded, (u32)ASSET_ENTRY_COUNT, assetsDir, skipped);

    /* Consider success if at least half loaded */
    return loaded > ASSET_ENTRY_COUNT / 2;
}
